import React from 'react';

const ShowDoc = ({doctor}) => {
    return (
        <div className="container-fluid">
            <div>
                {doctor.name}
            </div>
            <div>
            <img src={`http://localhost:5001/doctors`} alt="" />            </div>
        </div>
    );
};

export default ShowDoc;
